function Listo(){$("#ingresar_servicio").on("click",serviciosPage);$("#enviar_mail").on("click",enviarDatosMail)}function enviarDatosMail(){var e=$("#name").val();var t=$("#mail").val();var n=$("#mensaje").val();console.log(e);console.log(t);console.log(n);$.post("php/enviarMail.php",{nombrePHP:e,correoPHP:t,mensajePHP:n},function(){alert("Gracias por contactarnos!!..")})}function serviciosPage(){$(".servicios-icon").addClass("animated slideInLeft");$(".ui-block-b").addClass("animated lightSpeedIn");$(".servicios-icon, .ui-block-b").one("webkitAnimationEnd mozAnimationEnd MSAnimationEnd oanimationend animationend",function(){$(this).removeClass("animated slideInLeft lightSpeedIn")})}$(document).on("ready",Listo)